{"id": "6410", "title": "Bug 6410: File unchanged but dirtied by code assist", "description": "When using code assist in a Java file, if there are no suggestions, the file should not be marked as dirty.", "OB": "When code assist has nothing to suggest, it should not mark the file as dirty.", "EB": "If code assist has nothing to suggest, it should not mark the file as dirty.", "SR": "1122. To reproduce the issue, follow these steps:
1. Open a Java file.
2. Place the cursor inside the leftmost parenthesis of a method call, for example, consider "I" to be the cursor below:
   Object o = anotherObject.method(I);
3. Press Ctrl+Space."}
